import styled from "styled-components";

export const PageContainer = styled.div`
  margin-top: 60px;
  min-height: 100%;
  display: flex;
  flex-direction: column;
`;

export const ContactContainer = styled.div`
  display: flex;
  flex-direction: column;
  max-width: 60%;
  margin: 0 auto;
  justify-content: center;
`;
